import React from 'react';
import './ContactList.css';

const ContactList = () => {
  return (
    <div className="contact-list">
      <h1>Contact List</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Phone</th>
            <th>Email</th>
            <th>Last Interaction</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>John Doe</td>
            <td>(123) 456-7890</td>
            <td>johndoe@example.com</td>
            <td>Yesterday</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default ContactList;
